import React, { useEffect } from 'react';
import { StyleSheet, Text, View, TouchableOpacity } from 'react-native';
import { getAcceptList } from '../shared/acceptList';

export default function AcceptList() {
  let acceptList = getAcceptList();
  useEffect(() => {
    acceptList = getAcceptList();
  }, getAcceptList())
  return (
    <View style={styles.container}>
      {acceptList.map((favor) => {
        return (
          <View key={favor.id}>
            <Text>{favor.name}</Text>
            <Text>{favor.phone}</Text>
            {favor.items.map((item) => (
              <View key={item.title}>
                <Text>{item.title}</Text>
                <Text>{item.quantity}</Text>
              </View>
            ))}

            <TouchableOpacity 
              style={styles.button}
              onPress={() => {

              }}>
              <Text>Complete</Text>
            </TouchableOpacity>
          </View>
        )
      })}
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
